from math import prod, isqrt
from num2words import num2words
def n2w(n):
    return "".join(c for c in num2words(n).replace(" and", "") if c.isalpha())
def ok(n):
    d = [ord(c) - ord("A") + 1 for c in n2w(n).upper()]
    pr = prod(d)
    s = isqrt(pr)
    if s**2 != pr:
        return False
    p = 1
    for i in range(len(d)):
        p *= d[i]
        if p > s:
            return False
        if p == s:
            return True
for n in range(1, 100000):
    if ok(n):
        print(n, end=", ")
